package com.progium.catering.pojo;

/**
* Esta clase se encarga de crear el objeto evento catering
*
* @author  Progium<progiump3@gmail.com>
* @version 1.0
* @since   2015/08/08
*/
public class EventoCateringPOJO {
	
	private int idEventoCatering;
	private Integer cateringId;
	private Integer eventoId;
	
	public EventoCateringPOJO() {
		super();
		// TODO Auto-generated constructor stub
	}
	
	public int getIdEventoCatering() {
		return idEventoCatering;
	}
	
	public void setIdEventoCatering(int idEventoCatering) {
		this.idEventoCatering = idEventoCatering;
	}
	
	public Integer getCateringId() {
		return cateringId;
	}
	
	public void setCateringId(Integer cateringId) {
		this.cateringId = cateringId;
	}
	
	public Integer getEventoId() {
		return eventoId;
	}
	
	public void setEventoId(Integer eventoId) {
		this.eventoId = eventoId;
	}
	
	
	
	
	
}
